import React from "react";
import "./App.css";
import SquareComponent from "./Components/SquareComponent";
import { AppMain, Ptext, Row } from "./style/AppCss";

function App() {
  return (
    <div className="App">
      <AppMain>
        <Ptext>Tic Tac Toe Game</Ptext>
        <Row>
          <SquareComponent className=".b-bottom-right" />
          <SquareComponent className="b-bottom-right" />
          <SquareComponent className="b-bottom-right" />
        </Row>
        <Row>
          <SquareComponent className="b-bottom-right" />
          <SquareComponent className="b-bottom-right" />
          <SquareComponent className="b-bottom-right" />
        </Row>
        <Row>
          <SquareComponent className="b-right" />
          <SquareComponent className="b-right" />
          <SquareComponent className="b-right" />
        </Row>
      </AppMain>
    </div>
  );
}

export default App;
